import React, { Component } from "react";
import symboldefs from "./css/symbol-defs.svg";
import "./css/icon.css";

const icons = {
  HTML: { icon: "html5" },
  "React.js": { icon: "react" },
  CSS: { icon: "css3" },
  JS: { icon: "javascript" },
  "ASP.NET": { icon: "dot-net" },
  Python: { icon: "python" },
  "Raspberry Pi": { icon: "raspberrpi" },
  Photoshop: { icon: "adobephotoshop" },
  "Google Chrome Extensions": { icon: "chrome" }
};

export default class icon extends Component {
  render() {
    const { icon } = this.props;
    return icons[icon] ? (
      <i class="icon">
        <svg xmlns="http://www.w3.org/2000/svg" width="20" height="20">
          <use xlinkHref={`${symboldefs}#${"icon-" + icons[icon].icon}`} />
        </svg>
      </i>
    ) : (
      <span>{icon}</span>
    );
  }
}
